import { useState } from "react";

const Celebs = () => {
    //database
    let stars = [
        {
            img: "",
            name: "",
            id: 1
        },
        {
            img: "",
            name: "",
            id: 1
        },
        {
            img: "",
            name: "",
            id: 1
        },
        {
            img: "",
            name: "",
            id: 1
        },
        {
            img: "",
            name: "",
            id: 1
        }
    ]
    return (
        <div className="celebs">
            {
                stars.map(data => (
                    <div className="celebs_list">
                        <div className="image">
                            <img src={data.img} alt="" />
                        </div>
                        <div className="info">
                            <h1>{data.name}</h1>
                        </div>
                    </div>

                ))
            }
        </div>
    );
}

export default Celebs;
